// Define color scale based on the 'class' property directly from GeoJSON
function getColor(d) {
  return d === 10 ? '#990000' : // Dark red
         d === 9  ? '#CC0000' : // Red
         d === 8  ? '#FF0000' : // Bright red
         d === 7  ? '#FF3300' : // Orange-red
         d === 6  ? '#FF6600' : // Orange
         d === 5  ? '#FFCC00' : // Yellow-orange
         d === 4  ? '#FFFF00' : // Yellow
         d === 3  ? '#CCFF00' : // Light yellow-green
         d === 2  ? '#66FF00' : // Light green
         d === 1  ? '#00FF00' : // Green
                     '#FFFFE5';  // Fallback color (very light green)
					 
}


// Style function for the GeoJSON layer with better outline
function style(feature) {
  return {
    fillColor: getColor(feature.properties.class),  // Using 'class' property for color
    weight: 2,  // Outline thickness
    opacity: 1,
    color: '#f4fbf2',  // Dark gray outline
    dashArray: '0',  // No dashes, solid line
    fillOpacity: 0.7
  };
}

// Define the GeoJSON layer and add it to the map

      "</div>";
    layer.bindPopup(popupContent);
  }
});
